export default {
  data: function data() {
    return {
      createForm: {
        username: '',
        password: '',
        email: '',
        nickname: '',
        realname: '',
        phone: ''
      }
    };
  },
  methods: {
    open: function open() {
      this.$refs.userDialog.open();
      this.createForm = {
        username: '',
        password: '',
        email: '',
        nickname: '',
        realname: '',
        phone: ''
      };
    },
    onConfirmCreateType: function onConfirmCreateType(formName) {
      var _this = this;

      this.$refs[formName].validate(function (valid) {
        if (valid) {
          if (!_this.createForm.username) {
            _this.$message.error(_this.$t('AccountNoEmpty'));

            return false;
          } else if (!_this.createForm.password) {
            _this.$message.error(_this.$t('PasswordNoEmpty'));

            return false;
          } else if (!_this.createForm.email) {
            _this.$message.error(_this.$t('EmailNoEmpty'));

            return false;
          } else if (!_this.createForm.nickname) {
            _this.$message.error(_this.$t('NicknameNoEmpty'));

            return false;
          } else if (!_this.createForm.phone) {
            _this.$message.error(_this.$t('PhoneNoEmpty'));

            return false;
          }

          _this.$emit('success', {
            data: _this.createForm,
            code: 0
          });

          _this.$refs.userDialog.close();
        } else {
          return false;
        }
      });
    }
  }
};
